2. Laudo de análise nº 3982.00/2012 de 08/05/2012 emitido pelo Laboratório de Saúde Pública Dr. Giovanni Cysneiros do produto: palmito açaí em conserva, da marca Castelo coletado em 09/04/2012 neste estabelecimento.
